script: |
  super -f text -I q5236.spq | sort > q5236.out

inputs:
  - name: q5236.spq
    data: |
      SELECT DISTINCT - col0 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE + col1 / 47 NOT BETWEEN 62 / + ( - + 85 ) + + 0 AND - col0;
  - name: tab2

outputs:
  - name: q5236.out
    data: |
      -46
      -64
      -75
